public boolean regenerateItem(SolrIndexSearcher newSearcher, SolrCache newCache,
                              SolrCache oldCache, Object oldKey, Object oldVal) throws IOException {
  newCache.put(oldKey, oldVal);
  return true;
}

@Override
public boolean regenerateItem(SolrIndexSearcher newSearcher, SolrCache newCache,
                              SolrCache oldCache, Object oldKey, Object oldVal) throws IOException {
  newCache.put(oldKey, oldVal);
  return true;
}

